import React from "react";

const Showrombooks = (props) => {
    return (
        <div className={"container mm-4 mt-5"}>
            <div className={"row"}>
                <div className={"table-responsive"}>
                    <h1>{props.abstract}</h1>
                </div>
            </div>
        </div>
    );
}

export default Showrombooks;
